variables.value:
{
  title: {
    text: 'Last Seven Days Trend'
  },
  tooltip: {
    trigger: 'axis'
  },
  legend: {
    data: ['Total Users', 'New Users']
  },
  grid: {
    left: '3%',
    right: '4%',
    bottom: '7%',
    containLabel: true
  },
  toolbox: {
    feature: {
      saveAsImage: {}
    }
  },
  xAxis: {
    type: 'category',
    boundaryGap: true,
    data: JSObject1.fetchData().dates
  },
  yAxis: {
    type: 'value'
  },
  series: [{
    name: 'New Users',
    type: 'line',
    data: JSObject1.fetchData().new_users,
    label: {
      show: true,
      position: 'top'
    }
  }, {
    name: 'Total Users',
    type: 'line',
    data: JSObject1.fetchData().total_users,
    label: {
      show: true,
      position: 'top'
    }
  }]
}
